article_content:
생각보다 사이즈가 작네요~
그래도 안깨지고 도착한거에 만족해야 할것 같은....위 아래에만 골판박스를 대고 포장끈으로 고정되어왔네요~조금만 던지면 다깨졌을듯요~~;;
박스포장하면 마구 던질까봐 상품을 노출시킨걸지도 모르겠네요^^;
여튼 디자인은 귀여운편이지만 뚜껑이 얇아서 무거운걸 위로 쌓긴 불안해요~그냥 얇은 옷이나 수건, 애들 레고 같은것 정리하긴 좋아요. 참고하세요~^^

싼맛~에 구매했더니.. 깨져서 온다는분들말이 맞네요~
그래도 배송도빠르고~ 그냥.ㅡㅡ;긔찮아서 그냥 써요;
뚜껑열때 조금 손아파요~
